package javaSes;

public class SwitchCase {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	    char switchMe = 's';

        switch(switchMe){
            case 'a':
                System.out.println("Test A");
                break;
            case 's':
                System.out.println("Test B");
                break;
            case 'c':
                System.out.println("Test C");
                break;
            default:
                System.out.println("Test Default");
                break;
        }

	}

}
